import { Layout, Menu, Breadcrumb, Row, Col } from "antd";
import "./Profile.css";
import Icon, { MenuOutlined, CaretDownOutlined } from "@ant-design/icons";

const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

const PhoneSvg = () => (
  <svg width="15px" height="15px" viewBox="0 0 35 35">
    <g>
      <path
        d="M25.302,0H9.698c-1.3,0-2.364,1.063-2.364,2.364v30.271C7.334,33.936,8.398,35,9.698,35h15.604
		c1.3,0,2.364-1.062,2.364-2.364V2.364C27.666,1.063,26.602,0,25.302,0z M15.004,1.704h4.992c0.158,0,0.286,0.128,0.286,0.287
		c0,0.158-0.128,0.286-0.286,0.286h-4.992c-0.158,0-0.286-0.128-0.286-0.286C14.718,1.832,14.846,1.704,15.004,1.704z M17.5,33.818
		c-0.653,0-1.182-0.529-1.182-1.183s0.529-1.182,1.182-1.182s1.182,0.528,1.182,1.182S18.153,33.818,17.5,33.818z M26.021,30.625
		H8.979V3.749h17.042V30.625z"
      />
    </g>
  </svg>
);

const Sidebar = () => {
  return (
    <div>
      <Row>
        <Col flex="45px">
          <img
            src="https://salt.tikicdn.com/desktop/img/avatar.png"
            alt=""
            style={{ width: 45, borderRadius: 50 }}
          />
        </Col>
        <Col flex="150px">
          <div>Tài khoản của Trần Khánh Gia Uy</div>
        </Col>
      </Row>

      <Menu
        mode="inline"
        defaultSelectedKeys={["1"]}
        style={{ height: "100%", borderRight: 0 }}
      >
        <Menu.Item key="1">Thông tin tài khoản</Menu.Item>
        <Menu.Item key="2">Quản lý đơn hàng</Menu.Item>
        <Menu.Item key="3">option3</Menu.Item>
        <Menu.Item key="4">option4</Menu.Item>
      </Menu>
    </div>
  );
};

export default Sidebar;
